import App from '../../App';
import './Videos.scss';
import VideoList from '../VideoList/VideoList'

function Video(props) {
    let consoleId = event => {
        console.log(event.target.id);
    }


    return (
    <>
        
            <div className="VideoList__container">
                <div className="VideoList__image-container">
                <a className="VideoList__link" onClick={event => consoleId(event)} id={props.id}><img className="VideoList__image" src={props.image}/></a>
                </div>
                <div className="VideoList__text-container">
                    <p className="VideoList__title">{props.title}</p>
                    <p className="VideoList__author">{props.uploader}</p>
                </div>
            </div>
        
    </>
    );
}

export default Video;
